Description.

Holotype
male

(Lamington National Park, QM 
S83010
). Carapace orange-brown with darker bands around margins and posterior of cephalic region (
Fig. 18
). Fovea triangular with apex pointing anteriorly, and with a dark radiating pattern (
Fig. 18
). Moderately hirsute with fine white setae, more dense around carapace margins and eye region. Black rings around eyes. Chelicerae dark orange-brown with four promarginal teeth, apical tooth separated by width of one tooth, second tooth from proximal end much larger than others; three retromarginal teeth of similar size. Labium dark brown proximally, fading to white distally (
Fig. 19
). Sternum light brown with dark brown margin (
Fig. 19
). Abdomen dark brown, approximately round, but slightly tapered posteriorly, slightly longer than wide (
Fig. 18
). Small white markings on dorsal anterior surface of abdomen (
Fig. 18
). Indistinct horizontal band across abdomen posterior to small white markings, darker brown anteriorly of band, lighter brown posteriorly (
Fig. 18
). White dorsolateral patches visible at the ends of the horizontal band (
Fig. 18
). Faint scalloped markings visible on posterior lateral surface of abdomen. Legs pale yellow-brown with dark patches (
Figs 18, 19
). Tibiae I prolateral surface with a row of five short, very stout spines, tibiae II prolateral surface with two spines distally. Pedipalps with large dishshaped median apophysis (
Figs 4
, 
22
). Conductor elongate with cleft supporting short embolus, and proximal lobe adjacent to cleft (
Figs 4
, 
22
). Terminal apophysis short and curved basally (
Figs 4
, 
22, 23
).

Paratype
female

(Lamington National Park, QM 
S83011
). Female somatic characters are as in male with the following exceptions: chelicerae with four promarginal teeth, apical tooth not separate as in male, apical tooth and second tooth from proximal end much larger than others. Abdomen much larger, more rounded, less tapered posteriorly, wider than long (
Fig. 20
). Tibiae I prolateral surface with a row of six short, very stout spines, tibiae II prolateral surface with a row of five spines. Epigyne in ventral view approximately as wide as long (
Fig. 24
), moderately hirsute. Small distal portion of scape curved back anteriorly away from copulatory openings, indistinct median septum continuous with small posterior plate (
Figs 10
, 
25
). Spermathecae relatively large, spherical in shape (
Figs 24, 26
).
